import { motion } from 'framer-motion'

const PageVariants = {
    initial: {
      opacity: 0,
      x: "-100vw",
      scale: 0.8
    },
    in: {
        opacity: 1,
        x: 0,
        scale: 1
    },
    out: {
        opacity: 0,
        x: "-100vw",
        scale: 0.8
    }
  };

export default function Services() {
    return (
        <motion.div 
        initial="out"
        animate="in"
        exit="out"
        variants={PageVariants}
        transition={PageTransition}
        id="services-content"
        >
            SERVICES
        </motion.div> 
    )
}
